import React, { Component } from 'react'
import SearchExpert from "../DashbordComponents/SearchExpert"
import ProfileExpert from "../DashbordComponents/ProfileExpert"
import Barchart from "../Chart/chart"


export class DashbordExpert extends Component{
    render()
    {
        return(
            <div>
                <div className="row">
                <SearchExpert/>
                </div>
                <hr/>
                <div className="row">

                   <div className="col-md-2 col-sm-6"><ProfileExpert /></div>
                   <div className="col-md-5 col-sm-5"><Barchart/></div>
                   <div className="col-md-5"></div>

                </div>

            </div>
        )
    }
}

export default DashbordExpert ;
